script: |
  super -f text -I q367.spq | sort > q367.out

inputs:
  - name: q367.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE 51 NOT BETWEEN - - col1 + + col1 AND ( - - CAST ( + 90 AS INTEGER ) * + + col2 * col0 + + col2 );
  - name: tab1

outputs:
  - name: q367.out
    data: |
      91	47	68
